import{_ as s,C as n,c as r,o as l,aM as o,j as e,G as h,a as t}from"./chunks/framework.DAyGILei.js";const c="/assets/expired_certificate.B482RXIt.png",d="/assets/oauth_state_does_not_match.DYAPduMu.png",u="/assets/expired_server_cert.CVhzgb5E.png",p="/assets/rstudio-cannot-connect-R-session.DVuHyiuz.png",F=JSON.parse('{"title":"Troubleshooting","description":"HUNT Workbench troubleshooting.","frontmatter":{"title":"Troubleshooting","category":"HUNT Workbench","permalink":"/do-science/hunt-workbench/troubleshooting","outline":1,"description":"HUNT Workbench troubleshooting."},"headers":[],"relativePath":"do-science/hunt-workbench/troubleshooting.md","filePath":"do-science/hunt-workbench/troubleshooting.md"}'),k={name:"do-science/hunt-workbench/troubleshooting.md"};function b(f,a,m,g,y,w){const i=n("SDButton");return l(),r("div",null,[a[0]||(a[0]=o('<h1 id="hunt-workbench-troubleshooting" tabindex="-1">HUNT Workbench troubleshooting <a class="header-anchor" href="#hunt-workbench-troubleshooting" aria-label="Permalink to &quot;HUNT Workbench troubleshooting&quot;">​</a></h1><p><strong>Unfortunately, things don&#39;t always work as intended. Here is a collection of known issues that you might encounter in your HUNT Workbench. Contact us if you are still stuck after reading up.</strong></p><nav class="table-of-contents"><ul><li><a href="#access">Access</a><ul><li><a href="#unable-to-access-hunt-workbench-applications">Unable to access HUNT Workbench applications</a></li><li><a href="#_400-bad-request">400: Bad request</a></li><li><a href="#_400-bad-request-firefox">400: Bad request - Firefox</a></li><li><a href="#_403-forbidden-expired-client-certificate">403: Forbidden - Expired client certificate</a></li><li><a href="#_403-forbidden-oauth-state-does-not-match">403: Forbidden - oauth state does not match</a></li><li><a href="#_404-page-not-found-error">404: Page Not Found Error</a></li><li><a href="#_502-bad-gateway">502: Bad gateway</a></li><li><a href="#_504-gateway-timeout-error">504: Gateway Timeout Error</a></li><li><a href="#your-connection-is-not-private">Your connection is not private</a></li></ul></li><li><a href="#rstudio">RStudio</a><ul><li><a href="#cannot-connect-to-r-session">Cannot connect to R session</a></li><li><a href="#_500-internal-server-error-rstudio">500: Internal Server Error - RStudio</a></li><li><a href="#_504-gateway-timeout-error-rstudio">504: Gateway Timeout Error - RStudio</a></li></ul></li><li><a href="#matlab">MATLAB</a><ul><li><a href="#error-matlab-executable-not-found-in-path">Error - &#39;matlab&#39; executable not found in PATH</a></li><li><a href="#icons-in-user-interface-disappeared">Icons in user interface disappeared</a></li><li><a href="#missing-toolboxes">Missing toolboxes</a></li></ul></li><li><a href="#libreoffice">LibreOffice</a><ul><li><a href="#stuck-while-loading-the-libreoffice-application">Stuck while loading the LibreOffice application</a></li></ul></li><li><a href="#remote-desktop">Remote desktop</a><ul><li><a href="#accidentally-disabled-mouse-touchbar">Accidentally disabled mouse/touchbar</a></li></ul></li><li><a href="#experience">Experience</a><ul><li><a href="#unresponsive-environment">Unresponsive environment</a></li><li><a href="#workbench-is-missing-features-or-does-not-respond-after-restart">Workbench is missing features or does not respond after restart</a></li></ul></li><li><a href="#need-help">Need help</a></li></ul></nav><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>See our <a href="/do-science/hunt-workbench/faq">HUNT Workbench FAQ</a> for general questions, and our <a href="/do-science/hunt-workbench/installation#immediate-troubleshooting">Immediate troubleshooting</a> for issues during your first installation.</p></div><h2 id="access" tabindex="-1">Access <a class="header-anchor" href="#access" aria-label="Permalink to &quot;Access&quot;">​</a></h2><h3 id="unable-to-access-hunt-workbench-applications" tabindex="-1">Unable to access HUNT Workbench applications <a class="header-anchor" href="#unable-to-access-hunt-workbench-applications" aria-label="Permalink to &quot;Unable to access HUNT Workbench applications&quot;">​</a></h3><p>If you were previously able to access your applications (such as <em>RStudio</em>), and then the application suddenly stopped working, one quick approach is to check your available diskspace with following command:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">df</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -h</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /mnt/work</span></span></code></pre></div><p>If you have enough resources, try restarting your HUNT Workbench environment. Follow this guide to <a href="/do-science/hunt-workbench/faq#how-can-i-restart-my-workbench-environment">restart your workbench</a>.</p><p>If this does not help, you may have a look at our <a href="/do-science/hunt-workbench/faq">FAQ</a> or <a href="/do-science/hunt-workbench/troubleshooting">Troubleshooting</a> sections. <a href="/contact">Contact us</a> on email or reach out in your lab channel on Slack for further investigation if this does not help.</p><h3 id="_400-bad-request" tabindex="-1">400: Bad request <a class="header-anchor" href="#_400-bad-request" aria-label="Permalink to &quot;400: Bad request&quot;">​</a></h3><p>Try to restart your browser. If the error changes to 403 after restart head over to service desk and <a href="/do-science/service-desk/#hunt-workbench-reissue">request Workbench reissue</a>.</p><h3 id="_400-bad-request-firefox" tabindex="-1">400: Bad request - Firefox <a class="header-anchor" href="#_400-bad-request-firefox" aria-label="Permalink to &quot;400: Bad request - Firefox&quot;">​</a></h3><p>Try with Chrome or check troubleshooting guide for Firefox in your Lab access link to install HUNT Cloud CA certificate.</p><h3 id="_403-forbidden-expired-client-certificate" tabindex="-1">403: Forbidden - Expired client certificate <a class="header-anchor" href="#_403-forbidden-expired-client-certificate" aria-label="Permalink to &quot;403: Forbidden - Expired client certificate&quot;">​</a></h3><p>Your HUNT Workbench certificate is time limited. You will meet the <strong><code>403 Forbidden</code></strong> message when your certificate expire (example image below). Head over our do science <a href="/do-science/service-desk/#hunt-workbench-reissue">service desk</a> to order a certificate reissue.</p><p><img src="'+c+'" alt="expired_certificate.png"></p><h3 id="_403-forbidden-oauth-state-does-not-match" tabindex="-1">403: Forbidden - oauth state does not match <a class="header-anchor" href="#_403-forbidden-oauth-state-does-not-match" aria-label="Permalink to &quot;403: Forbidden - oauth state does not match&quot;">​</a></h3><p>Try to logout and login again. If logging in does not help, try different browser. We usually recommend Chrome, but here it is important to confirm whether it works in different browser. If this issue appear in all do not hesitate to reach out in your lab channel on Slack and remember to specify the error message <code>oauth state does not match</code>.</p><p><img src="'+d+'" alt="oauth_state_does_not_match.png"></p><h3 id="_404-page-not-found-error" tabindex="-1">404: Page Not Found Error <a class="header-anchor" href="#_404-page-not-found-error" aria-label="Permalink to &quot;404: Page Not Found Error&quot;">​</a></h3><p>Your workbench stopped working for no apparent reason and you are printed the NTNU logo with error <strong><code>404 error</code></strong>? Follow the link to your control panel. Click on the red button to stop your sever, this may take some time. Click on the green/blue button to launch your server again, this may also take some time. Reach out to us on <a href="/contact">Slack or email</a> if the problem is not resolved.</p><h3 id="_502-bad-gateway" tabindex="-1">502: Bad gateway <a class="header-anchor" href="#_502-bad-gateway" aria-label="Permalink to &quot;502: Bad gateway&quot;">​</a></h3><p>Reach out to us on <a href="/contact">Slack or email</a> if you get the <strong><code>502 error</code></strong> while trying to login to your HUNT Workbench. In such a case we may need to investigate potential causes on our end.</p><h3 id="_504-gateway-timeout-error" tabindex="-1">504: Gateway Timeout Error <a class="header-anchor" href="#_504-gateway-timeout-error" aria-label="Permalink to &quot;504: Gateway Timeout Error&quot;">​</a></h3><p>Reach out to us on <a href="/contact">Slack or email</a> if you get the <strong><code>504 error</code></strong> while trying to login to your HUNT Workbench. In such a case we may need to investigate potential causes on our end.</p><h3 id="your-connection-is-not-private" tabindex="-1">Your connection is not private <a class="header-anchor" href="#your-connection-is-not-private" aria-label="Permalink to &quot;Your connection is not private&quot;">​</a></h3><p>If you were previously able to access your HUNT Workbench and your browser suddenly reports expired/unsafe certificates, e.g.: <strong><code>Your connection is not private</code></strong> or <strong><code>ERR_CERT_DATE_INVALID</code></strong>, <a href="/contact">contact us</a> in your lab channel on Slack or contact us on email. We need to sign a new lab certificate and update the service.</p><p><img src="'+u+`" alt="expired_server_cert.png"></p><p>If your disk space is full, discuss with your lab leader/coordinator if you should cleanup your disk space, or order a volume extension in <a href="/administer-science/service-desk/lab-orders#expand-existing-volume">Service Desk</a></p><h2 id="rstudio" tabindex="-1">RStudio <a class="header-anchor" href="#rstudio" aria-label="Permalink to &quot;RStudio&quot;">​</a></h2><h3 id="cannot-connect-to-r-session" tabindex="-1">Cannot connect to R session <a class="header-anchor" href="#cannot-connect-to-r-session" aria-label="Permalink to &quot;Cannot connect to R session&quot;">​</a></h3><p>This warning popup usually appears after the change of R version.</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>Could not connect to the R session on RStudio Server.</span></span>
<span class="line"><span></span></span>
<span class="line"><span>Unable to connect service (1)</span></span>
<span class="line"><span></span></span>
<span class="line"><span>[Retry]</span></span></code></pre></div><p>Clicking on Retry button should resolve the problem.</p><p><img src="`+p+'" alt="rstudio-cannot-connect-R-session"></p><p>If the Rstudio does not start after clicking on Retry button, don&#39;t hesitate to reach out in your lab channel on Slack or <a href="/contact">contact us</a> for further assistance.</p><h3 id="_500-internal-server-error-rstudio" tabindex="-1">500: Internal Server Error - RStudio <a class="header-anchor" href="#_500-internal-server-error-rstudio" aria-label="Permalink to &quot;500: Internal Server Error - RStudio&quot;">​</a></h3><p>If you are a fast clicker and get to an app before it&#39;s initialized in the background you might get the following error message:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>500: Internal Server Error</span></span>\n<span class="line"><span>Could not start rstudio in time</span></span></code></pre></div><p>Try reloading the page (<strong><code>Ctrl + R</code></strong> / <strong><code>CMD + R</code></strong>) to reconnect with your <em>RStudio</em> session. <a href="/contact">Contact us</a> if the error message persists.</p><h3 id="_504-gateway-timeout-error-rstudio" tabindex="-1">504: Gateway Timeout Error - RStudio <a class="header-anchor" href="#_504-gateway-timeout-error-rstudio" aria-label="Permalink to &quot;504: Gateway Timeout Error - RStudio&quot;">​</a></h3><h4 id="solution-1" tabindex="-1">Solution 1 <a class="header-anchor" href="#solution-1" aria-label="Permalink to &quot;Solution 1&quot;">​</a></h4><p>The <strong><code>504 error</code></strong> may be shown when you access <strong><code>/user/&lt;username&gt;/rstudio/</code></strong> but <em>RStudio</em> fails to start. If you were previously able to access your <em>RStudio</em> in HUNT Workbench it is possible that <em>RStudio</em> saved more data in your environment files than it is able to load into memory.</p><p>One potential approach is to (1) first utilize your <a href="/do-science/hunt-workbench/faq#terminal">workbench terminal</a> to manually resetting your <em>RStudio</em> settings:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">mv</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;/mnt/work/workbench/${</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">USER</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">}/.local/share/rstudio&quot;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;/mnt/work/workbench/${</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">USER</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">}/.local/share/rstudio-$(</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">date</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> +%Y-%m-%d)&quot;</span></span></code></pre></div><p>And then (2) <a href="/do-science/hunt-workbench/faq#how-can-i-restart-my-workbench-environment-and-start-from-scratch">restart your HUNT Workbench environment</a>. If the error still persists, don&#39;t hesitate to reach out in your lab channel on Slack or <a href="/contact">contact us</a> for further assistance.</p><h4 id="solution-2" tabindex="-1">Solution 2 <a class="header-anchor" href="#solution-2" aria-label="Permalink to &quot;Solution 2&quot;">​</a></h4><p>Other potential issue might be full disk space in your <code>work</code> directory. You can check your disk space using following command:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">df</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -h</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /mnt/work</span></span></code></pre></div><h2 id="matlab" tabindex="-1">MATLAB <a class="header-anchor" href="#matlab" aria-label="Permalink to &quot;MATLAB&quot;">​</a></h2><h3 id="error-matlab-executable-not-found-in-path" tabindex="-1">Error - &#39;matlab&#39; executable not found in PATH <a class="header-anchor" href="#error-matlab-executable-not-found-in-path" aria-label="Permalink to &quot;Error - &#39;matlab&#39; executable not found in PATH&quot;">​</a></h3><p>Access to MATLAB requires the application to be installed and activated in your lab.</p><p>If you click on the MATLAB icon and the application is missing you will meet a red error box stating that &quot;<em>matlab executable not found in PATH</em>&quot;.</p><p>Contact your lab coordinator to investigate your licensing options and <a href="/contact">contact us</a> in Slack or email us with your installation request.</p><div class="tip custom-block"><p class="custom-block-title">NTNU users</p><p>NTNU holds licenses for all employees and students, so contact us if you want MATLAB in your lab.</p></div><h3 id="icons-in-user-interface-disappeared" tabindex="-1">Icons in user interface disappeared <a class="header-anchor" href="#icons-in-user-interface-disappeared" aria-label="Permalink to &quot;Icons in user interface disappeared&quot;">​</a></h3><p>You will need to reset your user settings if the MATLAB icons disappeared and your application is stuck loading. Removing user settings can be done in your <a href="/do-science/hunt-workbench/faq#terminal">workbench terminal</a>:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">ls</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /mnt/work/workbench/</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">$USER</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">/.matlab</span></span>\n<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">rm</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -r</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /mnt/work/workbench/</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">$USER</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">/.matlab</span></span></code></pre></div><h3 id="missing-toolboxes" tabindex="-1">Missing toolboxes <a class="header-anchor" href="#missing-toolboxes" aria-label="Permalink to &quot;Missing toolboxes&quot;">​</a></h3><p>You will most likely not be able to install these yourself. <a href="/contact">Contact us</a> on Slack or email if you need new toolboxes in your MATLAB installation.</p><h2 id="libreoffice" tabindex="-1">LibreOffice <a class="header-anchor" href="#libreoffice" aria-label="Permalink to &quot;LibreOffice&quot;">​</a></h2><h3 id="stuck-while-loading-the-libreoffice-application" tabindex="-1">Stuck while loading the LibreOffice application <a class="header-anchor" href="#stuck-while-loading-the-libreoffice-application" aria-label="Permalink to &quot;Stuck while loading the LibreOffice application&quot;">​</a></h3><p>If stuck while loading the LibreOffice application, try to restart Workbench to make sure that all instances of LibreOffice are stopped. Then open Workbench Terminal and remove lock files from past sessions using this command:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">find</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> ~/.local/config/libreoffice</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -type</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> f</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -name</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;.lock&quot;</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -print</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -delete</span></span></code></pre></div><h2 id="remote-desktop" tabindex="-1">Remote desktop <a class="header-anchor" href="#remote-desktop" aria-label="Permalink to &quot;Remote desktop&quot;">​</a></h2><h3 id="accidentally-disabled-mouse-touchbar" tabindex="-1">Accidentally disabled mouse/touchbar <a class="header-anchor" href="#accidentally-disabled-mouse-touchbar" aria-label="Permalink to &quot;Accidentally disabled mouse/touchbar&quot;">​</a></h3><ol><li><p>Open your <a href="/do-science/hunt-workbench/faq#terminal">workbench terminal</a>.</p></li><li><p>Copy paste this command to your terminal to reenable the mouse pointer device:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">DISPLAY</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">0</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> dbus-run-session</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> xfconf-query</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -c</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> pointers</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -p</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /TigerVNC_pointer/Properties/Device_Enabled</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -s</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> 1</span></span></code></pre></div></li><li><p>Follow the guide to <a href="/do-science/hunt-workbench/faq#how-can-i-restart-my-workbench-environment">Restart your Workbench environment</a>.</p></li></ol><h2 id="experience" tabindex="-1">Experience <a class="header-anchor" href="#experience" aria-label="Permalink to &quot;Experience&quot;">​</a></h2><h3 id="unresponsive-environment" tabindex="-1">Unresponsive environment <a class="header-anchor" href="#unresponsive-environment" aria-label="Permalink to &quot;Unresponsive environment&quot;">​</a></h3><p>An unresponsive or slow HUNT Workbench may be caused by several things. Here&#39;s a small checklist to narrow down potential causes:</p><ul><li>Use Google Chrome as your browser. Other browsers don&#39;t support all features and might cause potential silent failures.</li><li>Restart your HUNT Workbench environment to start fresh in the case something got hung up. <a href="/do-science/hunt-workbench/faq#how-can-i-restart-my-workbench-environment">Click here</a> to see how.</li><li>Check the resource consumption on your <strong><code>home</code></strong>-machine to ensure that you have available free CPU and memory resources, for example in <a href="/do-science/tools/technical/htop">HTOP</a> (see below).</li></ul>',72)),a[1]||(a[1]=e("div",{class:"expander-wrapper"},[e("a",{href:"#null",class:"header-anchor","aria-label":'Permalink to "Check your resources"',onclick:"document.querySelector('.expander236-null').setAttribute('open', '')"}," "),e("details",{class:"custom-block expander expander236-null",id:"null"},[e("summary",null,"Check your resources"),e("p",null,[t("One way to check your resource consumption is to log into your lab "),e("strong",null,[e("code",null,"home")]),t("-machine and run "),e("a",{href:"/do-science/tools/technical/htop"},"HTOP"),t(". Consider to upgrade the machine size in the administer science "),e("a",{href:"/administer-science/service-desk/lab-orders#update-cpu-machine-size"},"Service desk"),t(" if you are low on free resources.")])])],-1)),a[2]||(a[2]=o('<p><a href="/contact">Contact us</a> for further investigation if none of these works.</p><h3 id="workbench-is-missing-features-or-does-not-respond-after-restart" tabindex="-1">Workbench is missing features or does not respond after restart <a class="header-anchor" href="#workbench-is-missing-features-or-does-not-respond-after-restart" aria-label="Permalink to &quot;Workbench is missing features or does not respond after restart&quot;">​</a></h3><p>If your Workbench doesn&#39;t want to start up even after <a href="/do-science/hunt-workbench/faq#how-can-i-restart-my-workbench-environment">restart</a> or is missing features that worked before, you can run following command to clear your environment:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">rm</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -vf</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /mnt/work/workbench/</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">${USER}</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">/.jupyter/lab/workspaces/</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">*</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">.jupyterlab-workspace</span></span></code></pre></div><p>If you are logging in first time and you miss some icons or menus you need to update your internet browser (e.g. Google Chrome).</p><h2 id="need-help" tabindex="-1">Need help <a class="header-anchor" href="#need-help" aria-label="Permalink to &quot;Need help&quot;">​</a></h2><p>Did not find a solution to your problem?</p>',7)),h(i,{form:"request_workbench_troubleshooting"})])}const C=s(k,[["render",b]]);export{F as __pageData,C as default};
